import React, { useState } from 'react'


//getterlar ve setterlar vardır
//getterlar veriyi tutmakla yükümlüdür
//setterlar ise veriyi günclemekle yükümlüdür

//array destruacting




const Images = () => {

    const [classAdi,setClassAdi] = useState("")
    

        const changeView = () => {

            if(classAdi === "flex-container active"){
                setClassAdi("flex-container")
            }else{
                setClassAdi("flex-container active")
            }

        }


  return (

    <>

            <button onClick={changeView}>Görünümü Değiştir</button>

    
        <div className={classAdi}>

            <div>
                <img src="data:image/jpeg;base64," alt="" />
            </div>

            <div>
                <img src="data:image/jpeg;base64," alt="" />
            </div>

            <div>
                <img src="data:image/jpeg;base64," alt="" />
            </div>


        </div>

    </>


  )
}

export default Images